- input: "TEXT\x1CC00208991\x1CTEXT-00001\x1C\x1CF3XA\x1C-The October Monthly Report
    has been amended to identify the $7600.00 receipt disclosed on Schedule A supporting
    Line 11(a)(i) as a receipt from a general partnership with the allocation for
    each partner.- The report has been amended to clarify that the receipt from Friends
    of Schumer as a transfer. - The disbursement on Schedule B supporting Line 30(b)
    for Slate card to support the Democratic ticket was for Federal Election Activity.
    \ The Committee paid for the Slate card with entirely Federal funds and properly
    itemized the payment.  The payment did not constitute an in-kind contribution
    to the candidates featured on the Slate card.  The Slate card qualified for the
    Slate card exemption and was therefore not a contribution to any of the featured
    candidates. - The transfer(s)-in from the Democratic Senatorial Campaign Committee,
    Democratic National Committee, and Democratic Congressional Campaign Committee
    reported on Schedule A supporting Line 12 were not used to pay for the Vote-by-mail
    volunteer exempt mailpieces.  The transfers from the party committees were deposited
    into an account that was NOT used to make payments for mail pieces.  Furthermore,
    the transfers were not made to specifically fund this activity. The Vote-by-mail
    volunteer exempt mailpieces did not constitute an in-kind contribution to any
